import React from "react";
import logo from "../images/logo.png";

export default function header() {
  return (
    <div>
      <div className="navbar border-1">
        <nav className="mx-auto container my-5">
          <div className="logo">
            <img src={logo} alt="" srcset="" />
          </div>
          <div className="list-items  font-sans text-base  text-green">
            <ul className="lg:flex gap-5 justify-end -mt-7">
              <li>Home</li>
              <li>Home</li>
              <li>Home</li>
              <li>Home</li>
            </ul>
          </div>
        </nav>
      </div>
    </div>
  );
}
